4	EditText increases in size, goes over other Views	\N	2	2	2015-10-19 18:35:39	2015-11-04 00:06:08	0	\N	*Created by: tcarrio*\n\nEntering a name and hitting the arrow (enter) key makes the textbox drop down instead of going on to the next text field. If that textbox is extended all the way down over ‘Age’ and ‘Weight’ attempting to click on ‘Age’ or ‘Weight’ results in clicking on the enlarged ‘Name’ textbox.\n\nAfter typing out ‘51st’ and then hitting the green arrow (enter) key many times, the textbox for ‘Name:’ gets extended below. In the middle of the screen you see a pink line across the ‘150’ value. That is actually the textbox that is a part of ‘51st’. Assuming there was no value under ‘Age:’ and having the ‘51st’ textbox extended, clicking on ‘Age:’ (trying to insert your age) instead will open up ‘51st’ textbox.\n\nPotential Fix: Set android:single-line="true"\nin the XML of any textboxes we have. There's no need for any of them to extend past one line.\n<a href="http://stackoverflow.com/questions/10978038/restrict-edittext-to-single-line">StackOverflow answer on this topic.</a>\n	\N	closed	4	\N	f	\N	\N	\N	\N	EditText increases in size, goes over other Views	<p dir="auto"><em>Created by: tcarrio</em></p>\n\n<p dir="auto">Entering a name and hitting the arrow (enter) key makes the textbox drop down instead of going on to the next text field. If that textbox is extended all the way down over ‘Age’ and ‘Weight’ attempting to click on ‘Age’ or ‘Weight’ results in clicking on the enlarged ‘Name’ textbox.</p>\n\n<p dir="auto">After typing out ‘51st’ and then hitting the green arrow (enter) key many times, the textbox for ‘Name:’ gets extended below. In the middle of the screen you see a pink line across the ‘150’ value. That is actually the textbox that is a part of ‘51st’. Assuming there was no value under ‘Age:’ and having the ‘51st’ textbox extended, clicking on ‘Age:’ (trying to insert your age) instead will open up ‘51st’ textbox.</p>\n\n<p dir="auto">Potential Fix: Set android:single-line="true"\nin the XML of any textboxes we have. There's no need for any of them to extend past one line.\n<a href="http://stackoverflow.com/questions/10978038/restrict-edittext-to-single-line" rel="nofollow noreferrer" target="_blank">StackOverflow answer on this topic.</a></p>	0	\N
