12	App crashes on large calorie input on Workout page	\N	2	2	2015-10-19 18:45:52	2015-11-13 00:44:39	0	\N	*Created by: tcarrio*\n\nEntering a large caloric value (refer to ‘Enter Workout Page’) caused the completely crash and reset. It brought me back to the DashBoard (lost all data).\nEntering a large caloric value (refer to ‘Enter Food Page’) caused the completely crash and reset. It brought me back to the DashBoard (lost all data).\n\nEntered “804569805220” and hit Enter and the got the message “Unfortunately, FitFastApp has stopped.”\nApplication is brought back to the DashBoard. Everything is reset.  \nIf the caloric value inputted is a 10-digit number that does not start with a 0 or 1, the application will crash.\nApplication crashes on any 11-digit caloric value that doesn’t start with a 0.\nEntering a large caloric value ( 6 to 9-digit value ), makes the DashBoard lose its layout. [FIGURE 6]\n\n‘Enter Food’ Page\nEntered “5580888425756” and hit Enter and got the message “Unfortunately, FitFastApp has stopped.”\nApplication is brought back to the DashBoard. Everything is reset.  \nIf the caloric value inputted is a 10-digit number that does not start with a 0 or 1, the application will crash.\nApplication crashes on any 11-digit caloric value that doesn’t start with a 0.\nEntering a large caloric value ( 5 to 9-digit value ), makes the DashBoard lose its layout if no caloric value has been added to ‘Todays cals burned’. [FIGURE 6]\n\nPotential Fix: Uncaught NumberFormatException from:\n`int calories = Integer.parseInt(calsBurned.getText().toString());`\nNeed to catch and validate input data, there shouldn’t be any calories larger than int. We can put a TextWatcher or OnFocusChangeListener to check length and validity of user input, or simply catch the exception and display an error to the user. Strings should be no longer than 5 digits, validation on String.length would be easier than processing broad Exceptions. Regex for numerical input only, like "/^[0-9]+$/"\n	\N	closed	12	\N	f	\N	\N	\N	\N	App crashes on large calorie input on Workout page	<p dir="auto"><em>Created by: tcarrio</em></p>\n\n<p dir="auto">Entering a large caloric value (refer to ‘Enter Workout Page’) caused the completely crash and reset. It brought me back to the DashBoard (lost all data).\nEntering a large caloric value (refer to ‘Enter Food Page’) caused the completely crash and reset. It brought me back to the DashBoard (lost all data).</p>\n\n<p dir="auto">Entered “804569805220” and hit Enter and the got the message “Unfortunately, FitFastApp has stopped.”\nApplication is brought back to the DashBoard. Everything is reset.<br>\nIf the caloric value inputted is a 10-digit number that does not start with a 0 or 1, the application will crash.\nApplication crashes on any 11-digit caloric value that doesn’t start with a 0.\nEntering a large caloric value ( 6 to 9-digit value ), makes the DashBoard lose its layout. [FIGURE 6]</p>\n\n<p dir="auto">‘Enter Food’ Page\nEntered “5580888425756” and hit Enter and got the message “Unfortunately, FitFastApp has stopped.”\nApplication is brought back to the DashBoard. Everything is reset.<br>\nIf the caloric value inputted is a 10-digit number that does not start with a 0 or 1, the application will crash.\nApplication crashes on any 11-digit caloric value that doesn’t start with a 0.\nEntering a large caloric value ( 5 to 9-digit value ), makes the DashBoard lose its layout if no caloric value has been added to ‘Todays cals burned’. [FIGURE 6]</p>\n\n<p dir="auto">Potential Fix: Uncaught NumberFormatException from:\n<code>int calories = Integer.parseInt(calsBurned.getText().toString());</code>\nNeed to catch and validate input data, there shouldn’t be any calories larger than int. We can put a TextWatcher or OnFocusChangeListener to check length and validity of user input, or simply catch the exception and display an error to the user. Strings should be no longer than 5 digits, validation on String.length would be easier than processing broad Exceptions. Regex for numerical input only, like "/<sup>[0-9]+$/"</sup></p>	0	\N
