18	Authentication library	\N	2	2	2015-10-19 19:30:47	2015-11-04 15:06:09	0	\N	*Created by: tcarrio*\n\nCreate a library to return a hash from a String argument. \n\nImplement a trustworthy hashing algorithm that does not consume too much time or processing power, but also is strong enough to verify users password in a secure manner.\n\nThe method used here may be static, in order to make a call to the library without instantiating it. \n	1	closed	18	\N	f	\N	\N	\N	\N	Authentication library	<p dir="auto"><em>Created by: tcarrio</em></p>\n\n<p dir="auto">Create a library to return a hash from a String argument. </p>\n\n<p dir="auto">Implement a trustworthy hashing algorithm that does not consume too much time or processing power, but also is strong enough to verify users password in a secure manner.</p>\n\n<p dir="auto">The method used here may be static, in order to make a call to the library without instantiating it. </p>	0	\N
19	Add salt capability to security library	\N	2	2	2015-10-19 19:42:40	2015-11-04 15:09:57	0	\N	*Created by: tcarrio*\n\nImplement a salt on the hashing library, in order to make hashes unique to the user. \n\nThis will allow two users to have the same password without having the same hash result, making it more difficult to brute force or rainbow table the password. \n\nLiterature on a good methods to secure a hash with salts and iterative hashing: http://stackoverflow.com/questions/7523625/is-there-a-way-to-reverse-a-hash-without-rainbow-tables#7691164\n\n<a href="http://blog.jerryorr.com/2012/05/secure-password-storage-lots-of-donts.html">This article</a> outlines a uses case for Java specifically, using the National Institute of Standards and Technology's recommended PBKDF2. There is also bcrypt, which has the Java implementation <a href="https://code.google.com/p/jbcrypt/source/browse/trunk/src/main/java/org/mindrot/jbcrypt/BCrypt.java">jBCrypt</a>.\n\n<b>The following is the method I would like you to take for the encryption. It uses built-in libraries from Android and generates a more secure password than the current implementation.</b>\n\nhttp://blog.jerryorr.com/2012/05/secure-password-storage-lots-of-donts.html \nhttp://stackoverflow.com/questions/19348501/pbkdf2withhmacsha512-vs-pbkdf2withhmacsha1 \nhttps://developer.android.com/reference/javax/crypto/SecretKeyFactory.html \n\nBoth the salt and the password need to be saved to the database, so there will need to be two implementations of the method, one with and one without a salt parameter. The one with will bypass the randomly generated salt, in order to check passwords against the DB. The one without is for generating a new password for a user. \nThis could also be split into two methods differently, one that generates a salt and one that generates the salted hash. Ex:\n`public byte generateSalt(){}`\n`public byte[] generateHash(String pass, byte salt){}`\nThis way you can check before the hashing method whether it’s a login or a password creation/change, and use generateSalt or get it from the DB accordingly\n	1	closed	19	\N	f	\N	\N	\N	\N	Add salt capability to security library	<p dir="auto"><em>Created by: tcarrio</em></p>\n\n<p dir="auto">Implement a salt on the hashing library, in order to make hashes unique to the user. </p>\n\n<p dir="auto">This will allow two users to have the same password without having the same hash result, making it more difficult to brute force or rainbow table the password. </p>\n\n<p dir="auto">Literature on a good methods to secure a hash with salts and iterative hashing: <a href="http://stackoverflow.com/questions/7523625/is-there-a-way-to-reverse-a-hash-without-rainbow-tables#7691164" rel="nofollow noreferrer" target="_blank">http://stackoverflow.com/questions/7523625/is-there-a-way-to-reverse-a-hash-without-rainbow-tables#7691164</a></p>\n\n<p dir="auto"><a href="http://blog.jerryorr.com/2012/05/secure-password-storage-lots-of-donts.html" rel="nofollow noreferrer" target="_blank">This article</a> outlines a uses case for Java specifically, using the National Institute of Standards and Technology's recommended PBKDF2. There is also bcrypt, which has the Java implementation <a href="https://code.google.com/p/jbcrypt/source/browse/trunk/src/main/java/org/mindrot/jbcrypt/BCrypt.java" rel="nofollow noreferrer" target="_blank">jBCrypt</a>.</p>\n\n<p dir="auto"><b>The following is the method I would like you to take for the encryption. It uses built-in libraries from Android and generates a more secure password than the current implementation.</b></p>\n\n<p dir="auto"><a href="http://blog.jerryorr.com/2012/05/secure-password-storage-lots-of-donts.html" rel="nofollow noreferrer" target="_blank">http://blog.jerryorr.com/2012/05/secure-password-storage-lots-of-donts.html</a> \n<a href="http://stackoverflow.com/questions/19348501/pbkdf2withhmacsha512-vs-pbkdf2withhmacsha1" rel="nofollow noreferrer" target="_blank">http://stackoverflow.com/questions/19348501/pbkdf2withhmacsha512-vs-pbkdf2withhmacsha1</a> \n<a href="https://developer.android.com/reference/javax/crypto/SecretKeyFactory.html" rel="nofollow noreferrer" target="_blank">https://developer.android.com/reference/javax/crypto/SecretKeyFactory.html</a> </p>\n\n<p dir="auto">Both the salt and the password need to be saved to the database, so there will need to be two implementations of the method, one with and one without a salt parameter. The one with will bypass the randomly generated salt, in order to check passwords against the DB. The one without is for generating a new password for a user. \nThis could also be split into two methods differently, one that generates a salt and one that generates the salted hash. Ex:\n<code>public byte generateSalt(){}</code>\n<code>public byte[] generateHash(String pass, byte salt){}</code>\nThis way you can check before the hashing method whether it’s a login or a password creation/change, and use generateSalt or get it from the DB accordingly</p>	0	\N
